import React, { useState, useEffect } from "react";
import { Container, Paper } from "@material-ui/core/";
import MaterialTable from 'material-table'

export const SearchResults=() => {
  // const searchResults = "Search Results go here.";

  const[data, setData] = useState([])
  const columns = [
    {title:'Date', field:'CON_DATE'},
    {title:'Contributor', field:'CON_NAME'},
    {title:'Candidate', field:'cand_name'},
    {title:'Committee', field:'CMT_NAME', render:(data)=>{
      return `${data.CMT_NAME} ${data.cmt_id}`
    }},
    {title:'Amount', field:'CON_DATE'}
  ]

  useEffect(()=>{
    fetch("https://ethics.lacity.org/opendata/opendata_cmp_stmt_contributions_public_test.json")
    .then(resp=>resp.json())
      console.log(resp)
      .then(resp=>setData(resp))
  },[])

 /*const data=[
  {CMT_NAME:'Willie', cmt_id:'Jones'},
  {CMT_NAME:'Tara', cmt_id:'Didon'},
  {CMT_NAME:'Timothy', cmt_id:'Chiu'},
  {CMT_NAME:'Bob', cmt_id:'Boswell'}

  ] */

/*const columns=[
  {
    title:'firstName', field:'first_name', render:(data)=>{
     return `${data.name} ${data.last_name}`;
   }
  },
  {
    title:'lastName', field:'last_name'
  }
]
*/
  


  return (
    <Container>
      <Paper>
        <MaterialTable title="Material Table"
          columns={columns}
          data={data}
        />
      </Paper>
    </Container>
  );
}

export default SearchResults;
